import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom';
const Logout = () => {
    useEffect(() => {
        window.sessionStorage.removeItem("session");
        window.sessionStorage.clear();
        const navigate = useNavigate();
        navigate('/');
    }, [])
    return (
        <div>

        </div>
    )
}

export default Logout
